  fieldProps?: any;
  /** @name \u6620\u5C04\u503C\u7684\u7C7B\u578B */
  valueEnum?: ProSchemaValueEnumObj | ProSchemaValueEnumMap;

  /** @name \u4ECE\u670D\u52A1\u5668\u8BF7\u6C42\u679A\u4E3E */
  request?: ProFieldRequestData<ProSchema>;

  /** @name \u4ECE\u670D\u52A1\u5668\u8BF7\u6C42\u7684\u53C2\u6570\uFF0C\u6539\u53D8\u4E86\u4F1A\u89E6\u53D1 reload */
